define('css!ui/resume/resumeView',[],function(){});
define("html!ui/resume/resumeTemplate", ["handlebars"], function(handlebars){ 
return handlebars.default.template(function (Handlebars,depth0,helpers,partials,data) {
  this.compilerInfo = [4,'>= 1.0.0'];
helpers = this.merge(helpers, Handlebars.helpers); data = data || {};
  


  return "\n<!-- Resume Summary -->\n<div class=\"row\">\n  <div class=\"col-xs-12\">\n    <h3>Summary</h3>\n    <ul>\n        <li>Total 10+ Years of Web Development Experience</li>\n        <li>Experience in all stages of application development life cycle from conception to completion</li>\n        <li>Strong track record of translating business requirements into technical solutions</li>\n        <li>Leader with strong programming and analytical skills</li>\n        <li>Ability to work well in both a team environment and individual/remote environments</li>\n        <li>Excellent written and verbal communication skills</li>\n        <li>Specialties: JavaScript (Backbone), HTML5, CSS3, Application Development, Rich Internet Applications, Adobe Platform</li>\n      </ul>\n    </div>\n</div>\n\n<!-- Resume Experience -->\n<div class=\"row\">\n  <div class=\"col-xs-12\">\n    <h3>Experience</h3>\n    <ul class=\"list-group resume-list-group\">\n      <!-- Dave Collier Consulting -->\n      <li class=\"list-group-item\">\n        <p class=\"resume-job-title\">\n          Owner\n        </p>\n        <p class=\"resume-company-name\">Dave Collier Consulting</p>\n        <p class=\"resume-job-duration\">\n          October 2011 - Present (2 year 9 months)\n        </p>\n        <p class=\"resume-job-description\">\n          I provide clients with lightweight, intelligent mobile and desktop solutions. I went on my own in October of 2011 and work as an independent contractor. My focus is on mobile development, modern JavaScript, HTML5 and PHP.\n        </p>\n\n        <div class=\"row project\">\n          <div class=\"col-lg-6 col-md-12\">\n            <p class=\"resume-project-title\">TandemSeven</p>\n            <p class=\"resume-project-description\">Working as a consultant developing cutting edge user interfaces using HTML5, CSS3 and JavaScript.</p>\n          </div>\n          <div class=\"col-lg-6 col-md-12\">\n            <p class=\"resume-project-title\">Snap Studios</p>\n            <p class=\"resume-project-description\">Architected and build a front end framework for a next gen DIY SMB video creation tool using HTML5, JavaScript, PHP, mySQL and Amazon Web Services.</p>\n          </div>\n        </div>\n\n        <div class=\"row project\">\n          <div class=\"col-lg-6 col-md-12\">\n            <p class=\"resume-project-title\">Wolters Kluwer - Custom Storefront iPad Application (Part 2)</p>\n            <p class=\"resume-project-description\">Dave is returning for a second project with Wolters Kluwer as a UI/UX Developer. Dave is developing another custom store front iPad application. The platform runs off HTML5, JavaScript and Adobe Digital Publishing Suite.</p>\n          </div>\n          <div class=\"col-lg-6 col-md-12\">\n            <p class=\"resume-project-title\">iCIMS - Job Portal</p>\n            <p class=\"resume-project-description\">As a User Interface Developer, Dave helped improve the way candidates search for jobs on mobile devices and tablets by using responsive design.</p>\n          </div>\n        </div>\n\n        <div class=\"row project\">\n          <div class=\"col-lg-6 col-md-12\">\n            <p class=\"resume-project-title\">Wolters Kluwer - Custom Storefront iPad Application (Part 1)</p>\n            <p class=\"resume-project-description\">As a UI/UX Developer working as part of a medical research team, Dave is developed a custom store front for a suite of iPad applications. The platform runs off HTML5, JavaScript and Adobe Digital Publishing Suite.</p>\n          </div>\n          <div class=\"col-lg-6 col-md-12\">\n            <p class=\"resume-project-title\">Guavus - The Lounge</p>\n            <p class=\"resume-project-description\">Developed a content management system along with a front end that allows Guavus to market their products. Administrators can create access keys for clients, custom privileges and TTL.</p>\n          </div>\n        </div>\n\n        <div class=\"row project\">\n          <div class=\"col-lg-6 col-md-12\">\n            <p class=\"resume-project-title\">HealthiNation</p>\n            <p class=\"resume-project-description\">Dave acted as a Senior Web Developer for HealthiNation on a moonlighting/freelance basis for the good portion of 2012. Dave was responsible for maintaining, upgrading, adding features and deploying the video ad units. While working for HealthiNation Dave wrote an in-depth Google Analytics plugin for the ad units and created custom dashboards and reports giving business and marketing insight into campaigns and ad units.</p>\n          </div>\n          <div class=\"col-lg-6 col-md-12\">\n            <p class=\"resume-project-title\">Verizon - CDN Dashboard</p>\n            <p class=\"resume-project-description\">Designed and architected an analytics dashboard giving Verizon (end client) insight into CDN and network activity using existing Guavus platform.</p>\n          </div>\n        </div>\n\n        <div class=\"row project\">\n          <div class=\"col-lg-6 col-md-12\">\n            <p class=\"resume-project-title\">Toshiba - Innovation Map</p>\n            <p class=\"resume-project-description\">Developed a small content management system that allowed administrators to set plots on a map using Bing Maps (API), as well as upload media and information for each location. Front end using Bing Maps to show and drill down into location information and media.  This project was outsourced to me from a Digital Agency, who maintains and is responsible for the application.</p>\n          </div>\n        </div>\n\n      </li>\n\n      <!-- Clear Channel Communications -->\n      <li class=\"list-group-item\">\n        <p class=\"resume-job-title\">\n          Manager, Flash\n        </p>\n        <p class=\"resume-company-name\">Clear Channel Communications</p>\n        <p class=\"resume-job-duration\">\n          July 2009 - October 2011 (2 year 5 months)\n        </p>\n\n        <p class=\"resume-job-description\">Managed all Flash architecture and development ranging from widgets to applications</p>\n        <p class=\"resume-job-description\">Architected and managed an AS3 framework built around OSMF for internal and external development</p>\n        <p class=\"resume-job-description\">Technical lead for application development on multiple platforms (HP Touchpad, Blackberry Playbook, Yahoo TV, General Motors in dash application)</p>\n        <p class=\"resume-job-description\">Responsible for the iheartradio web player</p>\n        <p class=\"resume-job-description\">Developed numerous video players, widgets, and standalone applications</p>\n\n      </li>\n\n      <!-- Rockstar Games -->\n      <li class=\"list-group-item\">\n        <p class=\"resume-job-title\">\n          Senior Web Developer\n        </p>\n        <p class=\"resume-company-name\">Rockstar Games</p>\n        <p class=\"resume-job-duration\">\n          July 2008 - July 2009 (1 year 2 months)\n        </p>\n\n        <p class=\"resume-job-description\">Lead developer on internal projects</p>\n        <p class=\"resume-job-description\">Lead developer on 3rd party web service integration (XBOX Live / Play Station Network stats)</p>\n        <p class=\"resume-job-description\">Managed and developed internal research platform</p>\n\n      </li>\n\n      <!-- National Basketball Association (Contract) -->\n      <li class=\"list-group-item\">\n        <p class=\"resume-job-title\">\n          Senior Flash Engineer (Contract)\n        </p>\n        <p class=\"resume-company-name\">National Basketball Association</p>\n        <p class=\"resume-job-duration\">\n          January 2008 - June 2008 (6 months)\n        </p>\n        <p class=\"resume-job-description\">\n          <p>Responsible for Flash development during 2008 playoffs and finals</p>\n          <p>Developed various widgets and video players</p>\n        </p>\n      </li>\n\n      <!-- Corporate Incentives -->\n      <li class=\"list-group-item\">\n        <p class=\"resume-job-title\">\n          Developer\n        </p>\n        <p class=\"resume-company-name\">Corporate Incentives</p>\n        <p class=\"resume-job-duration\">\n          January 2005 - January 2008 (3 years 1 month)\n        </p>\n\n        <p class=\"resume-job-description\">Developed a Flash application allowing real estate agents to create variable data post cards</p>\n        <p class=\"resume-job-description\">Variable data print development using VB Script and JavaScript</p>\n        <p class=\"resume-job-description\">Backend development with a focus on Classic ASP and Micrsoft SQL Server</p>\n\n      </li>\n\n      <!-- MTV Networks -->\n      <li class=\"list-group-item\">\n        <p class=\"resume-job-title\">\n          Flash Developer (Contract)\n        </p>\n        <p class=\"resume-company-name\">MTV Networks</p>\n        <p class=\"resume-job-duration\">\n          January 2004 - January 2005 (1 year 1 month)\n        </p>\n\n        <p class=\"resume-job-description\">Developed prototypes using Actionscript 1,2 for MTV overdrive application</p>\n        <p class=\"resume-job-description\">Assisted in ActionScript and Flash development as needed for various projects</p>\n\n      </li>\n\n      <!-- USACE Army Corps of Engineers -->\n      <li class=\"list-group-item\">\n        <p class=\"resume-job-title\">\n          Web Master (Contract)\n        </p>\n        <p class=\"resume-company-name\">USACE Army Corps of Engineers</p>\n        <p class=\"resume-job-duration\">\n          January 2003 - December 2004 (2 years)\n        </p>\n\n        <p class=\"resume-job-description\">Maintained and incorporated new functionality for government websites and intranet</p>\n        <p class=\"resume-job-description\">Backend development with a focus on Classic ASP and Microsoft Access</p>\n\n      </li>\n\n    </ul>\n  </div>\n</div>\n<hr>\n";
  });
});

